import "./App.css";
import { useState } from "react";

import {
  BrowserRouter,
  Routes,
  Route,
  Router,
  Switch,

} from "react-router-dom";


import Home from "./components/Home";
import Search from "./components/Search";



function App() {

  return (
    <Routes>
      <div className="app">
      <Route path="/search" element={<Search />} />
      <Route path="/" element={<Home />} />

      </div>

    </Routes>
  );
}

export default App;
